import React, { useEffect } from "react";
import NavBa from "../../components/NavBa/NavBa";
// import './Browse.module.className'
function Browse() {
  useEffect(() => {
    const fetchMeals = async () => {
      const reponse = await fetch(
        "https://api.themoviedb.org/3//trending/all/week?api_key=d79a59f8d47b95ae03f0e52a9235a4de&language=en-US"
      );

      if (!reponse.ok) {
        throw new Error("something went wrong");
      }

      const reponseData = await reponse.json();
      const loadedMeals = [];

      for (const key in reponseData) {
        loadedMeals.push({
          id: key,
          backdrop_path: reponseData[key].backdrop_path,
          name: reponseData[key].name,
          original_language: reponseData[key].original_language,
          original_name: reponseData[key].original_name,
          overview: reponseData[key].overview,
        });
      }
    };
  });

  return (
    <div className="app">
      <NavBa />
    </div>
  );
}

export default Browse;
